{
  "commit-all": true,
  "scripts": {
    "prerelease": "node ./tools/prebump.js && npm run-script build-all",
    "postbump": "node ./tools/postbump.js",
    "postchangelog": "sed -i '' -e 's/### \\[/## [/g' CHANGELOG.md"
  },
  "types": [
    {
      "type": "feat",
      "section": "Features"
    },
    {
      "type": "fix",
      "section": "Fixes"
    },
    {
      "type": "chore",
      "hidden": true
    },
    {
      "type": "docs",
      "hidden": true
    },
    {
      "type": "style",
      "hidden": true
    },
    {
      "type": "refactor",
      "section": "Refactor",
      "hidden": false
    },
    {
      "type": "revert",
      "section": "Reverts",
      "hidden": false
    },
    {
      "type": "perf",
      "section": "Performance",
      "hidden": false
    },
    {
      "type": "test",
      "hidden": true
    }
  ]
}

const files = [
  "./test/**/*.test.mjs"
]

const environmentVariables = {}

if ('CITGM' in process.env) {
  files.push("!**/remote.test.mjs")
}

if ('electron' in process.versions) {
  files.push("!**/rsa-pss.test.mjs")
}

module.exports = {
  require: [
    "./test/.require.mjs"
  ],
  files,
  environmentVariables,
};

